🇨🇿 🇺🇦

Poslanecká sněmovna

  I.            kategoricky odsuzuje barbarskou, neomluvitelnou a nevyprovokovanou agresi Ruska proti Ukrajině, která je v rozporu se základními normami mezinárodního práva i zásadami vzájemných vztahů mezi civilizovanými národy a která ohrožuje jak životy nevinných lidí, tak samotné základy bezpečnostní architektury v Evropě;

 II.          vyjadřuje jednoznačný nesouhlas se lživou a agresivní rétorikou politického vedení Ruské federace, zejména jejího prezidenta Vladimira Vladimiroviče Putina, která má vojenský útok proti Ukrajině ospravedlnit a jež má za cíl zpochybnit její státní nezávislost i právo na její samotnou existenci; 

 III.          vyjadřuje nesouhlas s předchozími nelegálními kroky Ruské federace včetně uznání nezávislosti tzv. Doněcké lidové republiky a Luhanské lidové republiky, anexi Krymského poloostrova a vojenské okupace těchto území;

 IV.          vyjadřuje jednoznačnou podporu Ukrajině v této těžké chvíli, podporuje její územní celistvost a svrchovanost v mezinárodně uznaných hranicích a zdůrazňuje, že Ukrajina má plné právo na obranu svého území, stejně tak jako má právo na volbu svého vnitřního ústavního, společenského a politického uspořádání a svého zahraničně politického směřování;

 V.          oceňuje, že vláda České republiky razantně a urychleně odsoudila agresi Ruské federace vůči Ukrajině;

 VI.          vyzývá vládu České republiky, aby na příslušných mezinárodních fórech, včetně orgánů Evropské unie, důsledně prosazovala okamžité přijetí účinných sankcí proti Ruské federaci a fyzickým a právnickým osobám a případně i dalším zemím, které se podílí na agresi proti Ukrajině;

VII.          vyzývá vládu České republiky, aby nadále pokračovala ve svém úsilí na podporu Ukrajiny, a to jak bilaterálně, tak v rámci EU, NATO a dalších mezinárodních organizací, a aby Ukrajině poskytla humanitární, vojenskou a materiální pomoc;

 VIII.       vyzývá vládu České republiky, aby rychle a podstatným způsobem přispěla k posílení obranyschopnosti spojeneckých zemí východního křídla NATO,

 IX.          vyzývá Ruskou federaci, aby okamžitě zastavila vojenskou agresi proti Ukrajině a stáhla své jednotky z jejího území v mezinárodně uznávaných hranicích.

